@pq Are you working off Flutter master? For posterity, please include `flutter doctor` output.

The first error I believe is fixed on master via https://github.com/flutter/flutter/pull/15437. The second error about certificates has certainly been around for a long time. Whether it really needs to be an error, I'm not sure.

From the command line, you need to build plugin projects from the `example/` subfolder. Otherwise you don't have a Flutter app, and our current tooling only knows how to build apps.
